import React from 'react';
import './CareerHighlights.css';

const CareerHighlights = () => {
    return (
        <section className="career-highlights">
            <h2>Career Highlights</h2>
            <ul>
                <li>Debuted for India in 2008</li>
                <li>ICC Cricketer of the Year in 2017 and 2018</li>
                <li>Leading run-scorer in T20 Internationals</li>
                <li>Fastest century in ODIs by an Indian</li>
                <li>First player to score 4 double centuries in consecutive Test series</li>
            </ul>
        </section>
    );
};

export default CareerHighlights;
